    <div>
    <p class=MsoNormal style='text-align:justify'><span style='font-size:12.0pt;
    line-height:105%;font-family:"Arial",sans-serif;mso-ansi-language:ES-MX'>Smash
    Universe <span class=SpellE>Tournament</span> (2023) - 1er Lugar </span><span
    style='font-size:12.0pt;line-height:105%;font-family:"Segoe UI Emoji",sans-serif;
    mso-bidi-font-family:"Segoe UI Emoji";mso-ansi-language:ES-MX'>&#129351;</span><span
    style='font-size:12.0pt;line-height:105%;font-family:"Arial",sans-serif;
    mso-ansi-language:ES-MX'><o:p></o:p></span></p>
    <p class=MsoNormal style='text-align:justify'><span style='font-size:12.0pt;
    line-height:105%;font-family:"Arial",sans-serif;mso-ansi-language:ES-MX'>Un
    torneo internacional que reunió a los mejores jugadores de Smash Bros. <span
    class=SpellE>Dgti</span> <span class=SpellE>Esports</span> brilló con un
    desempeño impecable, mostrando su dominio en el juego y llevándose el
    primer lugar.<o:p></o:p></span></p>
    <p class=MsoNormal style='text-align:justify'><span style='font-size:12.0pt;
    line-height:105%;font-family:"Arial",sans-serif;mso-ansi-language:ES-MX'><o:p>&nbsp;</o:p></span></p>
    <p class=MsoNormal style='text-align:justify'><span style='font-size:12.0pt;
    line-height:105%;font-family:"Arial",sans-serif;mso-ansi-language:ES-MX'>Smash
    <span class=GramE>Masters</span> Series (2024) - 3er Lugar </span><span
    style='font-size:12.0pt;line-height:105%;font-family:"Segoe UI Emoji",sans-serif;
    mso-bidi-font-family:"Segoe UI Emoji";mso-ansi-language:ES-MX'>&#129353;</span><span
    style='font-size:12.0pt;line-height:105%;font-family:"Arial",sans-serif;
    mso-ansi-language:ES-MX'><o:p></o:p></span></p>
    <p class=MsoNormal style='text-align:justify'><span style='font-size:12.0pt;
    line-height:105%;font-family:"Arial",sans-serif;mso-ansi-language:ES-MX'>Una
    serie de torneos de alto nivel donde <span class=SpellE>Dgti</span> <span
    class=SpellE>Esports</span> compitió contra los mejores del mundo,
    alcanzando un respetable tercer lugar en la gran final de la serie.<o:p></o:p></span></p>
    <p class=MsoNormal style='text-align:justify'><span style='font-size:12.0pt;
    line-height:105%;font-family:"Arial",sans-serif;mso-ansi-language:ES-MX'><o:p>&nbsp;</o:p></span></p>
    <p class=MsoNormal style='text-align:justify'><span lang=EN-US
    style='font-size:12.0pt;line-height:105%;font-family:"Arial",sans-serif;
    mso-ansi-language:EN-US'>Ultimate Smash Fest (2022) - 2do Lugar </span><span
    style='font-size:12.0pt;line-height:105%;font-family:"Segoe UI Emoji",sans-serif;
    mso-bidi-font-family:"Segoe UI Emoji";mso-ansi-language:ES-MX'>&#129352;</span><span
    lang=EN-US style='font-size:12.0pt;line-height:105%;font-family:"Arial",sans-serif;
    mso-ansi-language:EN-US'><o:p></o:p></span></p>
    <p class=MsoNormal style='text-align:justify'><span style='font-size:12.0pt;
    line-height:105%;font-family:"Arial",sans-serif;mso-ansi-language:ES-MX'>Un
    evento nacional con una amplia gama de competidores. <span class=SpellE>Dgti</span>
    <span class=SpellE>Esports</span> llegó hasta la final, asegurando el
    segundo lugar tras una intensa serie de combates contra algunos de los
    mejores jugadores del país.<o:p></o:p></span></p>
    <p class=MsoNormal style='text-align:justify'><span style='font-size:12.0pt;
    line-height:105%;font-family:"Arial",sans-serif;mso-ansi-language:ES-MX'><o:p>&nbsp;</o:p></span></p>
    <p class=MsoNormal style='text-align:justify'><span lang=EN-US
    style='font-size:12.0pt;line-height:105%;font-family:"Arial",sans-serif;
    mso-ansi-language:EN-US'>Smash Battle Royale (2023) - 1er Lugar </span><span
    style='font-size:12.0pt;line-height:105%;font-family:"Segoe UI Emoji",sans-serif;
    mso-bidi-font-family:"Segoe UI Emoji";mso-ansi-language:ES-MX'>&#129351;</span><span

    <p class=MsoNormal style='text-align:justify'><span style='font-size:12.0pt;
    line-height:105%;font-family:"Arial",sans-serif;mso-ansi-language:ES-MX'>Un
    torneo con formato de eliminación rápida, donde <span class=SpellE>Dgti</span>
    <span class=SpellE>Esports</span> demostró su habilidad y consistencia,
    superando a todos sus oponentes para llevarse la victoria final.<o:p></o:p></span></p>
    <p class=MsoNormal style='text-align:justify'><span style='font-size:12.0pt;
    line-height:105%;font-family:"Arial",sans-serif;mso-ansi-language:ES-MX'><o:p>&nbsp;</o:p></span></p>
    <p class=MsoNormal style='text-align:justify'><span lang=EN-US
    style='font-size:12.0pt;line-height:105%;font-family:"Arial",sans-serif;
    mso-ansi-language:EN-US'>Super Smash Showdown (2024) - 2do Lugar </span><span
    style='font-size:12.0pt;line-height:105%;font-family:"Segoe UI Emoji",sans-serif;
    mso-bidi-font-family:"Segoe UI Emoji";mso-ansi-language:ES-MX'>&#129352;</span><span
    lang=EN-US style='font-size:12.0pt;line-height:105%;font-family:"Arial",sans-serif;
    mso-ansi-language:EN-US'><o:p></o:p></span></p>
    <p class=MsoNormal style='text-align:justify'><span style='font-size:12.0pt;
    line-height:105%;font-family:"Arial",sans-serif;mso-ansi-language:ES-MX'>Un
    evento regional destacado en el que <span class=SpellE>Dgti</span> <span
    class=SpellE>Esports</span> se enfrentó a una feroz competencia. A pesar de
    los desafíos, alcanzaron el segundo lugar tras una serie de combates
    emocionantes.<o:p></o:p></span></p>
    <p class=MsoNormal style='text-align:justify'><span style='font-size:12.0pt;
    line-height:105%;font-family:"Arial",sans-serif;mso-ansi-language:ES-MX'><o:p>&nbsp;</o:p></span></p>
    <p class=MsoNormal style='text-align:justify'><span style='font-size:12.0pt;
    line-height:105%;font-family:"Arial",sans-serif;mso-ansi-language:ES-MX'>Smash
    Bros. Grand Prix (2023) - 3er Lugar </span><span style='font-size:12.0pt;
    line-height:105%;font-family:"Segoe UI Emoji",sans-serif;mso-bidi-font-family:
    "Segoe UI Emoji";mso-ansi-language:ES-MX'>&#129353;</span><span
    style='font-size:12.0pt;line-height:105%;font-family:"Arial",sans-serif;
    mso-ansi-language:ES-MX'><o:p></o:p></span></p>
    <p class=MsoNormal style='text-align:justify'><span style='font-size:12.0pt;
    line-height:105%;font-family:"Arial",sans-serif;mso-ansi-language:ES-MX'>Un
    torneo que atrajo a jugadores de alto nivel de todo el país. <span
    class=SpellE>Dgti</span> <span class=SpellE>Esports</span> mantuvo su nivel
    de juego constante durante todo el evento, asegurando un lugar en el podio.<o:p></o:p></span></p>
    <p class=MsoNormal style='text-align:justify'><span style='font-size:12.0pt;
    line-height:105%;font-family:"Arial",sans-serif;mso-ansi-language:ES-MX'><o:p>&nbsp;</o:p></span></p>
    <p class=MsoNormal style='text-align:justify'><span lang=EN-US
    style='font-size:12.0pt;line-height:105%;font-family:"Arial",sans-serif;
    mso-ansi-language:EN-US'>Champion's Smash Cup (2022) - 1er Lugar </span><span
    style='font-size:12.0pt;line-height:105%;font-family:"Segoe UI Emoji",sans-serif;
    mso-bidi-font-family:"Segoe UI Emoji";mso-ansi-language:ES-MX'>&#129351;</span><span
    lang=EN-US style='font-size:12.0pt;line-height:105%;font-family:"Arial",sans-serif;
    mso-ansi-language:EN-US'><o:p></o:p></span></p>
    <p class=MsoNormal style='text-align:justify'><span style='font-size:12.0pt;
    line-height:105%;font-family:"Arial",sans-serif;mso-ansi-language:ES-MX'>Un
    torneo de campeones donde solo los mejores competían. <span class=SpellE>Dgti</span>
    <span class=SpellE>Esports</span> demostró su superioridad y habilidades
    excepcionales, llevándose el primer lugar tras una serie de actuaciones
    dominantes.<o:p></o:p></span></p>
    <p class=MsoNormal style='text-align:justify'><span style='font-size:12.0pt;
    line-height:105%;font-family:"Arial",sans-serif;mso-ansi-language:ES-MX'><o:p>&nbsp;</o:p></span></p>
    <p class=MsoNormal style='text-align:justify'><span lang=EN-US
    style='font-size:12.0pt;line-height:105%;font-family:"Arial",sans-serif;
    mso-ansi-language:EN-US'>Smash Legends Invitational (2023) - 2do Lugar </span><span
    style='font-size:12.0pt;line-height:105%;font-family:"Segoe UI Emoji",sans-serif;
    mso-bidi-font-family:"Segoe UI Emoji";mso-ansi-language:ES-MX'>&#129352;</span><span
    lang=EN-US style='font-size:12.0pt;line-height:105%;font-family:"Arial",sans-serif;
    mso-ansi-language:EN-US'><o:p></o:p></span></p>
    <p class=MsoNormal style='text-align:justify'><span style='font-size:12.0pt;
    line-height:105%;font-family:"Arial",sans-serif;mso-ansi-language:ES-MX'>Un
    torneo invitacional con los mejores jugadores del circuito. <span
    class=SpellE>Dgti</span> <span class=SpellE>Esports</span> luchó hasta la
    final, quedando en segundo lugar tras enfrentarse a un oponente de altísimo
    nivel.<o:p></o:p></span></p>
    <p class=MsoNormal style='text-align:justify'><span style='font-size:12.0pt;
    line-height:105%;font-family:"Arial",sans-serif;mso-ansi-language:ES-MX'><o:p>&nbsp;</o:p></span></p>
    <p class=MsoNormal style='text-align:justify'><span style='font-size:12.0pt;
    line-height:105%;font-family:"Arial",sans-serif;mso-ansi-language:ES-MX'>Smash
    Warriors League (2024) - 3er Lugar </span><span style='font-size:12.0pt;
    line-height:105%;font-family:"Segoe UI Emoji",sans-serif;mso-bidi-font-family:
    "Segoe UI Emoji";mso-ansi-language:ES-MX'>&#129353;</span><span
    style='font-size:12.0pt;line-height:105%;font-family:"Arial",sans-serif;
    mso-ansi-language:ES-MX'><o:p></o:p></span></p>
    <p class=MsoNormal style='text-align:justify'><span style='font-size:12.0pt;
    line-height:105%;font-family:"Arial",sans-serif;mso-ansi-language:ES-MX'>Una
    liga competitiva que reunió a los mejores talentos de la región. <span
    class=SpellE>Dgti</span> <span class=SpellE>Esports</span> se mantuvo
    competitivo durante toda la temporada, logrando un tercer lugar en la final
    gracias a su consistencia y habilidad.<o:p></o:p></span></p>
    <p class=MsoNormal style='text-align:justify'><span style='font-size:12.0pt;
    line-height:105%;font-family:"Arial",sans-serif;mso-ansi-language:ES-MX'><o:p>&nbsp;</o:p></span></p>
    <p class=MsoNormal style='text-align:justify'><span style='font-size:12.0pt;
    line-height:105%;font-family:"Arial",sans-serif;mso-ansi-language:ES-MX'>Ultimate
    Smash <span class=SpellE>Circuit</span> (2022) - 1er Lugar </span><span
    style='font-size:12.0pt;line-height:105%;font-family:"Segoe UI Emoji",sans-serif;
    mso-bidi-font-family:"Segoe UI Emoji";mso-ansi-language:ES-MX'>&#129351;</span><span
    style='font-size:12.0pt;line-height:105%;font-family:"Arial",sans-serif;
    mso-ansi-language:ES-MX'><o:p></o:p></span></p>
    <p class=MsoNormal style='text-align:justify'><span style='font-size:12.0pt;
    line-height:105%;font-family:"Arial",sans-serif;mso-ansi-language:ES-MX'>Un
    circuito de torneos en el que <span class=SpellE>Dgti</span> <span
    class=SpellE>Esports</span> se destacó en cada fase, mostrando una
    increíble habilidad y estrategia. Finalmente, se llevaron el primer lugar
    en la gran final del circuito.</span></p>

  src="LogrosSmash_archivos/image026.png"
  alt="Cuadro de texto: Smash Universe Tournament (2023) - 1er Lugar &#129351;&#13;&#10;Un torneo internacional que reunió a los mejores jugadores de Smash Bros. Dgti Esports brilló con un desempeño impecable, mostrando su dominio en el juego y llevándose el primer lugar.&#13;&#10;&#13;&#10;Smash Masters Series (2024) - 3er Lugar &#129353;&#13;&#10;Una serie de torneos de alto nivel donde Dgti Esports compitió contra los mejores del mundo, alcanzando un respetable tercer lugar en la gran final de la serie.&#13;&#10;&#13;&#10;Ultimate Smash Fest (2022) - 2do Lugar &#129352;&#13;&#10;Un evento nacional con una amplia gama de competidores. Dgti Esports llegó hasta la final, asegurando el segundo lugar tras una intensa serie de combates contra algunos de los mejores jugadores del país.&#13;&#10;&#13;&#10;Smash Battle Royale (2023) - 1er Lugar &#129351;&#13;&#10;Un torneo con formato de eliminación rápida, donde Dgti Esports demostró su habilidad y consistencia, superando a todos sus oponentes para llevarse la victoria final.&#13;&#10;&#13;&#10;Super Smash Showdown (2024) - 2do Lugar &#129352;&#13;&#10;Un evento regional destacado en el que Dgti Esports se enfrentó a una feroz competencia. A pesar de los desafíos, alcanzaron el segundo lugar tras una serie de combates emocionantes.&#13;&#10;&#13;&#10;Smash Bros. Grand Prix (2023) - 3er Lugar &#129353;&#13;&#10;Un torneo que atrajo a jugadores de alto nivel de todo el país. Dgti Esports mantuvo su nivel de juego constante durante todo el evento, asegurando un lugar en el podio.&#13;&#10;&#13;&#10;Champion's Smash Cup (2022) - 1er Lugar &#129351;&#13;&#10;Un torneo de campeones donde solo los mejores competían. Dgti Esports demostró su superioridad y habilidades excepcionales, llevándose el primer lugar tras una serie de actuaciones dominantes.&#13;&#10;&#13;&#10;Smash Legends Invitational (2023) - 2do Lugar &#129352;&#13;&#10;Un torneo invitacional con los mejores jugadores del circuito. Dgti Esports luchó hasta la final, quedando en segundo lugar tras enfrentarse a un oponente de altísimo nivel.&#13;&#10;&#13;&#10;Smash Warriors League (2024) - 3er Lugar &#129353;&#13;&#10;Una liga competitiva que reunió a los mejores talentos de la región. Dgti Esports se mantuvo competitivo durante toda la temporada, logrando un tercer lugar en la final gracias a su consistencia y habilidad.&#13;&#10;&#13;&#10;Ultimate Smash Circuit (2022) - 1er Lugar &#129351;&#13;&#10;Un circuito de torneos en el que Dgti Esports se destacó en cada fase, mostrando una increíble habilidad y estrategia. Finalmente, se llevaron el primer lugar en la gran final del circuito.&#13;&#10;"
